<script>
(function(){
  const EXIT_PIN = "2580"; // <-- CAMBIA EL PIN AQU
  let buffer = "";
  let unlocked = false;

  // Block links and navigation
  document.addEventListener('click', function(e){
    const a = e.target.closest('a');
    if(a){
      e.preventDefault();
      e.stopPropagation();
      return false;
    }
  }, true);

  // Disable window navigation methods
  const block = () => { throw new Error("Navigation blocked"); };
  window.open = block;
  window.print = block;
  Object.defineProperty(window.location, 'href', {
    set: block
  });

  // Disable context menu, selection, drag
  document.addEventListener('contextmenu', e => e.preventDefault());
  document.addEventListener('selectstart', e => e.preventDefault());
  document.addEventListener('dragstart', e => e.preventDefault());

  // Block keys (back, refresh, etc)
  document.addEventListener('keydown', function(e){
    const forbidden = ['Backspace','Escape','F5'];
    if(forbidden.includes(e.key) || (e.ctrlKey && ['r','w','n','t'].includes(e.key.toLowerCase()))){
      e.preventDefault();
      e.stopPropagation();
    }

    // PIN capture
    if(/^[0-9]$/.test(e.key)){
      buffer += e.key;
      if(buffer.length > EXIT_PIN.length) buffer = buffer.slice(-EXIT_PIN.length);
      if(buffer === EXIT_PIN){
        unlocked = true;
        alert("Modo administrador desbloqueado");
      }
    }
  }, true);

  // Prevent leaving unless unlocked
  window.addEventListener('beforeunload', function (e) {
    if(!unlocked){
      e.preventDefault();
      e.returnValue = '';
    }
  });

  // Invisible admin corner (top-left 80x80)
  const zone = document.createElement('div');
  zone.style.cssText = "position:fixed;top:0;left:0;width:80px;height:80px;z-index:99999;";
  document.body.appendChild(zone);

  let pressTimer;
  zone.addEventListener('touchstart', start);
  zone.addEventListener('mousedown', start);
  zone.addEventListener('touchend', cancel);
  zone.addEventListener('mouseup', cancel);

  function start(){
    pressTimer = setTimeout(()=>{
      const pin = prompt("Cdigo administrador:");
      if(pin === EXIT_PIN){
        unlocked = true;
        alert("Modo administrador desbloqueado");
      }
    }, 1500);
  }
  function cancel(){
    clearTimeout(pressTimer);
  }
})();
</script>
